@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:ATM a owl:Class .
atm:BankComputer a owl:Class .
atm:CashCard a owl:Class .
atm:Password a owl:Class .

atm:sendsRequestToVerifyPassword a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Password .

atm:checksPassword a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Password .

atm:validFor a owl:ObjectProperty ;
  rdfs:domain atm:Password ;
  rdfs:range atm:CashCard .

atm:validCashCard a owl:Class ;
  rdfs:subClassOf atm:CashCard ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:validFor ;
                     owl:someValuesFrom atm:Password ] .

atm:PasswordVerification a owl:Class ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:sendsRequestToVerifyPassword ;
                     owl:someValuesFrom atm:Password ] ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:checksPassword ;
                     owl:someValuesFrom atm:Password ] ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:validFor ;
                     owl:someValuesFrom atm:validCashCard ] .
